<#
.SYNOPSIS
    Creates a portable Python environment with all dependencies bundled.
    No Python installation required - this script is completely standalone.

.DESCRIPTION
    Downloads Python embeddable package, sets up pip, and installs requirements.
    Uses delvewheel to bundle DLLs directly into packages for true portability.
    The output is a standalone python folder that runs on any Windows machine.

.PARAMETER Requirements
    Path to requirements.txt file (required)

.PARAMETER PythonVersion
    Python version to use: 3.9, 3.10, 3.11, 3.12 (default: 3.11)

.PARAMETER OutputDir
    Output directory (default: .\portable_python)

.EXAMPLE
    .\make_portable_python.ps1 -Requirements requirements.txt -PythonVersion 3.11 -OutputDir .\portable_python
#>

param(
    [string]$Requirements,
    [string]$PythonVersion = "3.11",
    [string]$OutputDir = ".\portable_python"
)

# Python embeddable package URLs
$PythonUrls = @{
    "3.12" = "https://www.python.org/ftp/python/3.12.7/python-3.12.7-embed-amd64.zip"
    "3.11" = "https://www.python.org/ftp/python/3.11.9/python-3.11.9-embed-amd64.zip"
    "3.10" = "https://www.python.org/ftp/python/3.10.11/python-3.10.11-embed-amd64.zip"
    "3.9"  = "https://www.python.org/ftp/python/3.9.13/python-3.9.13-embed-amd64.zip"
}

$GetPipUrl = "https://bootstrap.pypa.io/get-pip.py"

# Embedded VC++ Runtime DLLs (Base64 encoded)
# These are extracted during script execution to ensure portability on clean machines
$EmbeddedVCRuntime = @{
    "concrt140.dll" = ""
    "msvcp140.dll" = ""
    "msvcp140_1.dll" = ""
    "vcomp140.dll" = ""
    "vcruntime140.dll" = ""
    "vcruntime140_1.dll" = ""
    "msvcp140_2.dll" = ""
    "msvcp140_atomic_wait.dll" = ""
    "msvcp140_codecvt_ids.dll" = ""
    "vcamp140.dll" = ""
    "vccorlib140.dll" = ""
    "vcruntime140_threads.dll" = ""
}


# Validate parameters
if (-not $Requirements) {
    Write-Host ""
    Write-Host "Portable Python Maker" -ForegroundColor Cyan
    Write-Host ""
    Write-Host "Usage:" -ForegroundColor Yellow
    Write-Host "  .\make_portable_python.ps1 -Requirements <path> [-PythonVersion <ver>] [-OutputDir <path>]"
    Write-Host ""
    Write-Host "Flags:" -ForegroundColor Yellow
    Write-Host "  -Requirements   Path to requirements.txt file (required)"
    Write-Host "  -PythonVersion  Python version: 3.9, 3.10, 3.11, 3.12 (default: 3.11)"
    Write-Host "  -OutputDir      Output directory (default: .\portable_python)"
    Write-Host ""
    Write-Host "Example:" -ForegroundColor Yellow
    Write-Host "  .\make_portable_python.ps1 -Requirements requirements.txt -PythonVersion 3.11 -OutputDir .\portable_python"
    Write-Host ""
    exit 1
}

if (-not $PythonUrls.ContainsKey($PythonVersion)) {
    Write-Host "Error: Unsupported Python version: $PythonVersion" -ForegroundColor Red
    Write-Host "Supported versions: $($PythonUrls.Keys -join ', ')"
    exit 1
}

if ($Requirements -and -not (Test-Path $Requirements)) {
    Write-Host "Error: Requirements file not found: $Requirements" -ForegroundColor Red
    exit 1
}

# Setup - resolve all paths immediately using PowerShell's current location
# Use Push-Location/Pop-Location pattern to ensure correct path resolution
Push-Location $PWD
$OutputDir = $ExecutionContext.SessionState.Path.GetUnresolvedProviderPathFromPSPath($OutputDir)
$RequirementsPath = $ExecutionContext.SessionState.Path.GetUnresolvedProviderPathFromPSPath($Requirements)
Pop-Location
$PythonExe = Join-Path $OutputDir "python.exe"

Write-Host ""
Write-Host "============================================================" -ForegroundColor Cyan
Write-Host "          Portable Python Maker (with delvewheel)           " -ForegroundColor Cyan
Write-Host "============================================================" -ForegroundColor Cyan
Write-Host ""

# Clean output directory if exists
if (Test-Path $OutputDir) {
    Write-Host "Cleaning existing output directory..." -ForegroundColor Yellow
    Remove-Item -Path $OutputDir -Recurse -Force
}

New-Item -ItemType Directory -Path $OutputDir -Force | Out-Null

# Step 1: Download Python embeddable
Write-Host ""
Write-Host "[1/7] Downloading Python $PythonVersion embeddable..." -ForegroundColor Green

$PythonUrl = $PythonUrls[$PythonVersion]
$PythonZip = Join-Path $env:TEMP "python-embed.zip"

try {
    $ProgressPreference = 'SilentlyContinue'  # Faster download
    Invoke-WebRequest -Uri $PythonUrl -OutFile $PythonZip -UseBasicParsing
    Write-Host "  Downloaded Python embeddable package" -ForegroundColor Gray
} catch {
    Write-Host "Error downloading Python: $_" -ForegroundColor Red
    exit 1
}

# Extract Python
Write-Host "  Extracting..." -ForegroundColor Gray
Expand-Archive -Path $PythonZip -DestinationPath $OutputDir -Force
Remove-Item $PythonZip -Force

# Enable pip by modifying python*._pth file
$pthFile = Get-ChildItem -Path $OutputDir -Filter "python*._pth" | Select-Object -First 1
if ($pthFile) {
    $content = Get-Content $pthFile.FullName -Raw
    $content = $content -replace "#import site", "import site"
    if ($content -notmatch "Lib\\site-packages") {
        $content += "`nLib\site-packages`n"
    }
    Set-Content -Path $pthFile.FullName -Value $content -NoNewline
    Write-Host "  Configured Python for pip support" -ForegroundColor Gray
}

# Create Lib/site-packages directory
$sitePackages = Join-Path $OutputDir "Lib\site-packages"
New-Item -ItemType Directory -Path $sitePackages -Force | Out-Null

# Create sitecustomize.py to add current working directory to path and register DLL directories
$siteCustomize = Join-Path $sitePackages "sitecustomize.py"
$siteCustomizeContent = @"
import sys
import os
import ctypes

# Add current working directory to Python path
cwd = os.getcwd()
if cwd not in sys.path:
    sys.path.insert(0, cwd)

# Get the directory where Python executable is located
python_dir = os.path.dirname(sys.executable)

# Pre-load VC++ runtime DLLs using ctypes to ensure they're available
# This must happen early, before any packages that depend on them are imported
vc_dlls = [
    'vcruntime140.dll', 'vcruntime140_1.dll', 'vcruntime140_threads.dll',
    'msvcp140.dll', 'msvcp140_1.dll', 'msvcp140_2.dll',
    'msvcp140_atomic_wait.dll', 'msvcp140_codecvt_ids.dll',
    'concrt140.dll', 'vcomp140.dll', 'vccorlib140.dll', 'vcamp140.dll'
]
for dll in vc_dlls:
    dll_path = os.path.join(python_dir, dll)
    if os.path.exists(dll_path):
        try:
            ctypes.WinDLL(dll_path)
        except OSError:
            pass

# For Python 3.8+, register DLL search directories
# This is a fallback for packages that delvewheel couldn't fully repair
if hasattr(os, 'add_dll_directory'):
    # Add the Python directory itself
    if os.path.isdir(python_dir):
        os.add_dll_directory(python_dir)

    # Add all .libs directories from installed packages
    site_packages = os.path.join(python_dir, 'Lib', 'site-packages')
    if os.path.isdir(site_packages):
        for item in os.listdir(site_packages):
            if item.endswith('.libs'):
                libs_path = os.path.join(site_packages, item)
                if os.path.isdir(libs_path):
                    os.add_dll_directory(libs_path)
            # Also check inside package directories for .libs folders
            pkg_path = os.path.join(site_packages, item)
            if os.path.isdir(pkg_path):
                pkg_libs = os.path.join(pkg_path, '.libs')
                if os.path.isdir(pkg_libs):
                    os.add_dll_directory(pkg_libs)

# Monkey-patch json5 to add legacy decode submodule for compatibility
# Some older code uses json5.decode.JSONDecodeError which no longer exists
try:
    import json5
    import types

    # Create a fake decode module with JSONDecodeError
    decode_module = types.ModuleType('json5.decode')
    decode_module.JSONDecodeError = ValueError  # Use ValueError as fallback

    # Try to find the actual JSON5 exception
    if hasattr(json5, 'JSON5DecodeError'):
        decode_module.JSONDecodeError = json5.JSON5DecodeError

    json5.decode = decode_module
    sys.modules['json5.decode'] = decode_module
except ImportError:
    pass
"@
Set-Content -Path $siteCustomize -Value $siteCustomizeContent
Write-Host "  Added sitecustomize.py for working directory and DLL support" -ForegroundColor Gray

# Step 2: Install pip
Write-Host ""
Write-Host "[2/7] Installing pip..." -ForegroundColor Green

$getPipPath = Join-Path $env:TEMP "get-pip.py"
try {
    Invoke-WebRequest -Uri $GetPipUrl -OutFile $getPipPath -UseBasicParsing
    Write-Host "  Downloaded get-pip.py" -ForegroundColor Gray
} catch {
    Write-Host "Error downloading get-pip.py: $_" -ForegroundColor Red
    exit 1
}

# Run get-pip.py
$pipResult = & $PythonExe $getPipPath --no-warn-script-location 2>&1
if ($LASTEXITCODE -ne 0) {
    Write-Host "Error installing pip: $pipResult" -ForegroundColor Red
    exit 1
}
Remove-Item $getPipPath -Force
Write-Host "  pip installed successfully" -ForegroundColor Gray

# Step 3: Install delvewheel
Write-Host ""
Write-Host "[3/7] Installing delvewheel (DLL bundling tool)..." -ForegroundColor Green

& $PythonExe -m pip install delvewheel --no-warn-script-location 2>&1 | Out-Null
if ($LASTEXITCODE -ne 0) {
    Write-Host "Error installing delvewheel" -ForegroundColor Red
    exit 1
}
Write-Host "  delvewheel installed successfully" -ForegroundColor Gray

# Step 4: Extract embedded VC++ Runtime DLLs
Write-Host ""
Write-Host "[4/7] Extracting embedded VC++ runtime DLLs..." -ForegroundColor Green

$vcDllDir = Join-Path $env:TEMP "vc_runtime_dlls"
if (Test-Path $vcDllDir) { Remove-Item -Path $vcDllDir -Recurse -Force }
New-Item -ItemType Directory -Path $vcDllDir -Force | Out-Null

# Extract embedded DLLs from Base64
$extractedCount = 0
foreach ($dllName in $EmbeddedVCRuntime.Keys) {
    $base64 = $EmbeddedVCRuntime[$dllName]
    $bytes = [Convert]::FromBase64String($base64)

    # Write to temp directory for delvewheel
    $tempPath = Join-Path $vcDllDir $dllName
    [IO.File]::WriteAllBytes($tempPath, $bytes)

    # Write to output directory for runtime
    $outputPath = Join-Path $OutputDir $dllName
    [IO.File]::WriteAllBytes($outputPath, $bytes)

    $extractedCount++
}

Write-Host "  Extracted $extractedCount embedded VC++ DLL(s)" -ForegroundColor Gray

# Step 5: Download wheels
Write-Host ""
Write-Host "[5/7] Downloading wheels..." -ForegroundColor Green

$wheelDir = Join-Path $env:TEMP "portable_python_wheels"
$repairedWheelDir = Join-Path $env:TEMP "portable_python_wheels_repaired"

# Clean wheel directories
if (Test-Path $wheelDir) { Remove-Item -Path $wheelDir -Recurse -Force }
if (Test-Path $repairedWheelDir) { Remove-Item -Path $repairedWheelDir -Recurse -Force }
New-Item -ItemType Directory -Path $wheelDir -Force | Out-Null
New-Item -ItemType Directory -Path $repairedWheelDir -Force | Out-Null

Write-Host "  Downloading from: $RequirementsPath" -ForegroundColor Gray
$downloadOutput = & $PythonExe -m pip download -r $RequirementsPath -d $wheelDir 2>&1
if ($LASTEXITCODE -ne 0) {
    Write-Host "Error downloading wheels:" -ForegroundColor Red
    Write-Host $downloadOutput -ForegroundColor Red
    exit 1
}

$wheels = Get-ChildItem -Path $wheelDir -Filter "*.whl"
Write-Host "  Downloaded $($wheels.Count) wheel(s)" -ForegroundColor Gray

# Step 6: Repair wheels with delvewheel (using downloaded VC++ DLLs)
Write-Host ""
Write-Host "[6/7] Repairing wheels with delvewheel..." -ForegroundColor Green

$repairedCount = 0
$skippedCount = 0

# Build the add-path argument for delvewheel
$addPathArgs = @()
if ((Test-Path $vcDllDir) -and (Get-ChildItem -Path $vcDllDir -Filter "*.dll" -ErrorAction SilentlyContinue)) {
    $addPathArgs += "--add-path"
    $addPathArgs += $vcDllDir
    Write-Host "  Using downloaded VC++ DLLs for bundling" -ForegroundColor Gray
}

foreach ($wheel in $wheels) {
    $wheelName = $wheel.Name

    # Check if it's a platform-specific wheel (needs repair) or pure Python (skip)
    if ($wheelName -match "win.*\.whl$" -or $wheelName -match "cp\d+.*win") {
        Write-Host "  Repairing: $wheelName" -ForegroundColor Gray

        # Run delvewheel with --add-path to include our downloaded DLLs
        if ($addPathArgs.Count -gt 0) {
            $repairResult = & $PythonExe -m delvewheel repair $wheel.FullName -w $repairedWheelDir $addPathArgs 2>&1
        } else {
            $repairResult = & $PythonExe -m delvewheel repair $wheel.FullName -w $repairedWheelDir 2>&1
        }
        $repairExitCode = $LASTEXITCODE

        # Check if a repaired wheel was created
        $repairedWheelCreated = Get-ChildItem -Path $repairedWheelDir -Filter "$($wheel.BaseName.Split('-')[0])*" -ErrorAction SilentlyContinue

        if ($repairExitCode -eq 0 -and $repairedWheelCreated) {
            $repairedCount++
            Write-Host "    OK - DLLs bundled" -ForegroundColor DarkGray
        } else {
            # If repair fails or no output, copy original
            Write-Host "    No DLLs needed, using original" -ForegroundColor DarkGray
            Copy-Item -Path $wheel.FullName -Destination $repairedWheelDir -Force
            $skippedCount++
        }
    } else {
        # Pure Python wheel, no repair needed
        Copy-Item -Path $wheel.FullName -Destination $repairedWheelDir -Force
        $skippedCount++
    }
}

Write-Host "  Repaired: $repairedCount wheel(s), Skipped: $skippedCount wheel(s)" -ForegroundColor Gray

# Step 7: Install repaired wheels
Write-Host ""
Write-Host "[7/7] Installing repaired packages..." -ForegroundColor Green

# Install all repaired wheels (with dependencies this time)
$repairedWheels = Get-ChildItem -Path $repairedWheelDir -Filter "*.whl"
foreach ($wheel in $repairedWheels) {
    & $PythonExe -m pip install $wheel.FullName --no-warn-script-location --force-reinstall --no-deps 2>&1 | Out-Null
}

# Ensure all dependencies are resolved (pip will skip already-installed packages)
& $PythonExe -m pip install -r $RequirementsPath --no-warn-script-location 2>&1 | Out-Null

Write-Host "  All packages installed successfully" -ForegroundColor Gray

# Cleanup wheel directories
Remove-Item -Path $wheelDir -Recurse -Force -ErrorAction SilentlyContinue
Remove-Item -Path $repairedWheelDir -Recurse -Force -ErrorAction SilentlyContinue

# Remove delvewheel (not needed at runtime)
Write-Host "  Removing build tools..." -ForegroundColor Gray
& $PythonExe -m pip uninstall delvewheel -y --no-warn-script-location 2>&1 | Out-Null

# Cleanup VC++ DLL temp directory
Remove-Item -Path $vcDllDir -Recurse -Force -ErrorAction SilentlyContinue

# Copy DLLs from package .libs folders to Python directory
$libsDirs = Get-ChildItem -Path $sitePackages -Directory -Filter "*.libs" -ErrorAction SilentlyContinue
foreach ($libsDir in $libsDirs) {
    $dllFiles = Get-ChildItem -Path $libsDir.FullName -Filter "*.dll" -ErrorAction SilentlyContinue
    foreach ($dllFile in $dllFiles) {
        $destPath = Join-Path $OutputDir $dllFile.Name
        if (-not (Test-Path $destPath)) {
            Copy-Item -Path $dllFile.FullName -Destination $destPath -Force
        }
    }
}

# Get folder size
$size = (Get-ChildItem -Path $OutputDir -Recurse | Measure-Object -Property Length -Sum).Sum / 1MB
$sizeStr = "{0:N0} MB" -f $size

# Done!
Write-Host ""
Write-Host "============================================================" -ForegroundColor Cyan
Write-Host "          Portable Python Created Successfully!             " -ForegroundColor Cyan
Write-Host "============================================================" -ForegroundColor Cyan
Write-Host ""
Write-Host "Output: $OutputDir" -ForegroundColor White
Write-Host "Size:   $sizeStr" -ForegroundColor White
Write-Host ""
Write-Host "Usage:" -ForegroundColor Yellow
Write-Host "  .\portable_python\python.exe                   - Launch Python interpreter"
Write-Host "  .\portable_python\python.exe script.py         - Run a Python script"
Write-Host "  .\portable_python\python.exe -m pip install X  - Install more packages"
Write-Host "  .\portable_python\python.exe -m pip list       - List installed packages"
Write-Host ""
Write-Host "Copy the folder to any Windows PC - no Python installation needed!" -ForegroundColor Green
